function App() {
  const days = new Date().getTime();
  const daysSince = days / (1000 * 60 * 60);

  const birthday = new Date(2022, 4, 5).getTime() / (1000 * 60 * 60);
  const daysUntill = (birthday - daysSince) / 24;
  const hoursUntill = (birthday - daysSince) % 24;

  setTimeout(() => {}, 1000);

  return (
    <div>
      <h2>{daysUntill}</h2>
      <h2>{hoursUntill}</h2>
      <h2>{daysUntill}</h2>
    </div>
  );
}

export default App;
